        WebCallMobileBluetooth: function (action, callback) {
            var that = this;
            this.setupWebViewJavascriptBridge(function (bridge) {
                //向OC发送指令
                bridge.callHandler("WebCallMobileBluetooth", { action: action }, null);
                that.bluetooth.callback = that.bluetooth.callback || {};
                that.bluetooth.callback[action] = callback;

                if (!that.bluetooth.register || that.bluetooth.register !== true) {
                    //同时开启监听函数
                    bridge.registerHandler("MobileBluetoothCallback", function (data) {
                        //处理原生代码发过来的蓝牙相关数据                                                
                        //data={device,status,[data],[errcode]} status="data"时有data字段，status="error"时有errcode信息且errcode=101时表示初始化时写指令失败！
                        //此外status="start"：开始成功 stop：结束成功
                        var cb = that.bluetooth.callback;

                        if (!cb[data.status]) {
                            console.log("receive message from OC,but no handler!", data);
                            return;
                        }

                        if (data.status == "start" || data.status == "stop") {
                            that.bluetooth.working = data.status == "start" ? true : false;
                            if (data.status == "stop" && !cb[data.status]) {
                                alert("蓝牙接收异常终止！");
                            } else {
                                cb[data.status]({ status: data.status + ":ok" });
                                cb[data.status] = null;
                            }
                        } else if (data.status == "error") {
                            if (data.errcode == 101) {
                                cb["start"]({ status: "start:fail", message: "写入指令失败！" });
                            } else {
                                cb[data.status](data);
                            }
                        } else if (data.status == "data" && that.bluetooth.working === true) {
                            cb[data.status](data.data);
                        }
                    });

                    //定义出error处理函数
                    that.bluetooth.callback["error"] = console.error;
                    that.bluetooth.register = true;
                }
            });
        },
